import React from 'react'

const Navbar = () => {
    return (
        <AppBar position="static">
            <Toolbar>
                <IconButton><MenuIcon/></IconButton>
                <Typography>Liv Score</Typography>
            </Toolbar>
        </AppBar>
    )
}

export default Navbar
